INSERT INTO public.photoshots (id,created_at,photospot_id,name,recreate_text,photo_paths,created_by) VALUES (11, DEFAULT, 2, 'Sunset at the Beach', 'Recreate by standing in a vintage-style bar, wearing a suit and holding a cocktail.', '{"https://picsum.photos/id/[object Object]/400/400","https://picsum.photos/id/[object Object]/400/400","https://picsum.photos/id/[object Object]/400/400"}', NULL), (12, DEFAULT, 2, 'Fashion Show', 'Recreate by standing in a beautiful park, wearing a casual outfit and holding a frisbee.', '{"https://picsum.photos/id/[object Object]/400/400","https://picsum.photos/id/[object Object]/400/400","https://picsum.photos/id/[object Object]/400/400"}', NULL), (13, DEFAULT, 2, 'Cozy Morning', 'To recreate, find a modern gym, wear a workout outfit and hold a pair of dumbbells.', '{"https://picsum.photos/id/[object Object]/400/400","https://picsum.photos/id/[object Object]/400/400","https://picsum.photos/id/[object Object]/400/400"}', NULL), (14, DEFAULT, 2, 'Sunflower Field', 'Recreate by standing in a beautiful forest, wearing a hiking outfit and holding a walking stick.', '{"https://picsum.photos/id/[object Object]/400/400","https://picsum.photos/id/[object Object]/400/400","https://picsum.photos/id/[object Object]/400/400"}', NULL), (15, DEFAULT, 2, 'Sandy Toes', 'Recreate by standing in a beautiful forest, wearing a hiking outfit and holding a walking stick.', '{"https://picsum.photos/id/[object Object]/400/400","https://picsum.photos/id/[object Object]/400/400","https://picsum.photos/id/[object Object]/400/400"}', NULL), (16, DEFAULT, 2, 'Beachy Keen', 'Capture a photo of yourself standing in front of a beautiful garden, wearing a wide-brimmed hat and holding a basket of flowers.', '{"https://picsum.photos/id/[object Object]/400/400","https://picsum.photos/id/[object Object]/400/400","https://picsum.photos/id/[object Object]/400/400"}', NULL), (17, DEFAULT, 2, 'Cozy Morning', 'Capture a photo of yourself standing in front of a beautiful garden, wearing a wide-brimmed hat and holding a basket of flowers.', '{"https://picsum.photos/id/[object Object]/400/400","https://picsum.photos/id/[object Object]/400/400","https://picsum.photos/id/[object Object]/400/400"}', NULL), (18, DEFAULT, 2, 'Cozy Morning', 'Recreate by standing in a modern kitchen, wearing a chef''s hat and holding a mixing bowl.', '{"https://picsum.photos/id/[object Object]/400/400","https://picsum.photos/id/[object Object]/400/400","https://picsum.photos/id/[object Object]/400/400"}', NULL), (19, DEFAULT, 2, 'Foodie Heaven', 'To recreate, find a vintage-inspired background, wear a flowy dress and hold a vintage-style camera.', '{"https://picsum.photos/id/[object Object]/400/400","https://picsum.photos/id/[object Object]/400/400","https://picsum.photos/id/[object Object]/400/400"}', NULL), (20, DEFAULT, 2, 'Fashionable Friends', 'Sit on a rooftop, wearing a trendy outfit and holding a pair of binoculars.', '{"https://picsum.photos/id/[object Object]/400/400","https://picsum.photos/id/[object Object]/400/400","https://picsum.photos/id/[object Object]/400/400"}', NULL);
